import React, { Component } from 'react'

export default class checkbox extends Component {
    constructor(props){
super(props);
this.state={};
    }
  render() {
      const {data}=this.props;
    return (
        data.map((lang)=>
            <label key={lang.name}><input type="checkbox" onClick={this.props.onChange} value={lang.language}/>{lang.language}</label>
                  )
    )
  }
}
